// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

error FundLeftNotEnough(uint256 left, uint256 required);

/// @title PLAN-BEE TGAS 服务费自动扣费系统合约
/// @author Iwan Cao
/// @notice 开放使用合约，任何人可以注册自己的余额系统
/// @custom:planbee 这是一个PLAN-BEE计划认证的合约

/// @dev contributor: 作者，每次被调用收取费用
/// @dev angency： 代理商，代收费，充值，提现
/// @dev sponsor： 赞助商：出钱，使用功能付费
contract TGas {
    /// @dev 针对每个代理商的客户余额
    mapping(address => mapping(address => uint256)) private AS_balance;
    /// @dev 针对每个作者的账户余额
    mapping(address => mapping(address => uint256)) private AC_balance;
    /// @dev 针对每个作者的代理商列表
    mapping(address => address[]) private CA_list;
    /// @dev 针对每个代理商的作者列表
    mapping(address => address[]) private AC_list;
    /// @dev 针对每个代理商的赞助商列表
    mapping(address => address[]) private AS_list;
    /// @dev 针对每个赞助商的代理商列表
    mapping(address => address[]) private SA_list;

    event Charge(address agency, address sponsor, uint256 amount);
    event Cash(address agency, address contributor, uint256 amount);
    event Bill(
        address sponsor,
        address agency,
        address contributor,
        uint256 amount,
        string info
    );

    /// @dev Angency functions
    function charge(address _sponsor, uint256 _amount) external {
        AS_balance[tx.origin][_sponsor] += _amount;

        if (AS_list[tx.origin].length == 0) AS_list[tx.origin] = [_sponsor];
        else _insert(AS_list[tx.origin], _sponsor);

        if (SA_list[_sponsor].length == 0) SA_list[_sponsor] = [tx.origin];
        else _insert(SA_list[_sponsor], tx.origin);

        emit Charge(tx.origin, _sponsor, _amount);
    }

    function cash(address _contributor, uint256 _amount) external {
        if (AC_balance[tx.origin][_contributor] < _amount)
            revert FundLeftNotEnough(
                AC_balance[tx.origin][_contributor],
                _amount
            );
        AC_balance[tx.origin][_contributor] -= _amount;
        if (AC_balance[tx.origin][_contributor] == 0) {
            _remove(CA_list[_contributor], tx.origin);
            _remove(AC_list[tx.origin], _contributor);
        }

        emit Cash(tx.origin, _contributor, _amount);
    }

    /// @dev Sponsor functions
    function bill(
        address _angency,
        address _contributor,
        uint256 _amount,
        string memory _info
    ) public {
        if (AS_balance[_angency][tx.origin] < _amount)
            revert FundLeftNotEnough(AS_balance[_angency][tx.origin], _amount);

        AS_balance[_angency][tx.origin] -= _amount;
        AC_balance[_angency][_contributor] += _amount;

        if (CA_list[_contributor].length == 0)
            CA_list[_contributor] = [_angency];
        else _insert(CA_list[_contributor], _angency);

        if (AC_list[_angency].length == 0) AC_list[_angency] = [_contributor];
        else _insert(AC_list[_angency], _contributor);

        emit Bill(tx.origin, _angency, _contributor, _amount, _info);
    }

    /// @dev View functions
    function balance_AC(address _agency) external view returns (uint256) {
        return AC_balance[_agency][tx.origin];
    }

    function balance_AC() external view returns (uint256) {
        uint256 total = 0;
        for (uint256 i = 0; i < CA_list[tx.origin].length; i++)
            total += AC_balance[CA_list[tx.origin][i]][tx.origin];
        return total;
    }

    function balance_CA(address _contributor) external view returns (uint256) {
        return AC_balance[tx.origin][_contributor];
    }

    function balance_CA() external view returns (uint256) {
        uint256 total = 0;
        for (uint256 i = 0; i < AC_list[tx.origin].length; i++)
            total += AC_balance[tx.origin][AC_list[tx.origin][i]];
        return total;
    }

    function balance_SA(address _sponsor) external view returns (uint256) {
        return AS_balance[tx.origin][_sponsor];
    }

    function balance_SA() external view returns (uint256) {
        uint256 total = 0;
        for (uint256 i = 0; i < AS_list[tx.origin].length; i++)
            total += AS_balance[tx.origin][AS_list[tx.origin][i]];
        return total;
    }

    function balance_AS(address _agency) external view returns (uint256) {
        return AS_balance[_agency][tx.origin];
    }

    function balance_AS() external view returns (uint256) {
        uint256 total = 0;
        for (uint256 i = 0; i < SA_list[tx.origin].length; i++)
            total += AS_balance[SA_list[tx.origin][i]][tx.origin];
        return total;
    }

    /// @dev Internal functions
    function _insert(address[] storage _list, address _newMember) internal {
        uint256 length = _list.length;
        for (uint256 i = 0; i < length; i++) {
            if (_list[i] == _newMember) return;
        }
        _list.push(_newMember);
    }

    function _remove(address[] storage _list, address _member)
        internal
        returns (bool)
    {
        uint256 length = _list.length;
        if (length == 0) return false;
        if (length == 1)
            if (_list[0] == _member) {
                _list.pop();
                return true;
            } else return false;

        uint256 i = 0;
        bool found = false;
        for (; i < length - 1; i++) {
            if (_list[i] == _member) found = true;
            if (found) _list[i] = _list[i + 1];
        }
        if (_list[i] == _member) found = true;
        if (found) _list.pop();
        return found;
    }
}
